import React, {Component} from 'react';
import ReactPaginate from 'react-paginate';
import { connect } from "react-redux";
import { fetchInfos } from '../actions/uscensuslearnActions';
class HomePage extends Component {
	constructor(){
		super()
		this.state={
			val:"",
			nb_person: 0, 
			nb_line: 0,
			loading: false,
			currentPage: 1,
			personPerPage: 10
		}
	}
	componentDidMount(){
		
		this.props.fetchInfos()
		
	}
	

	renderNumberOfBien(){
		this.setState({
			nb_person : this.props.infos.length
		})
    	
    	return this.state.nb_person;
    }

	paginate(pageNumber){
		this.setState({
			currentPage: pageNumber
		},() => {
		  this.props.fetchInfos();
		});
	}
  

	render(){
		
		const {infos} = this.props.infos;
		console.log(infos)
		return(
			<div>
				<div style={{marginTop:'4em'}}>
				
				<div className="bg-light p-3">
				    <div className="row  d-flex justify-content-start">
				       <div className="col-md-4">
				         <a href="" className="btn btn-success d-block font-weight-bold rounded-0">
				          <i className="fas fa-plus"></i> &nbsp;Ajouter un bien</a>
				       </div>   
				  </div>
 				</div> 

 				<div className="container-fluid">
				    <div className="row"> 
				      <div className="col-md-4 mt-4">
				          <div className="card">
				            <div className="text-white p-4" style={{backgroundColor:'#00cccb'}}>
				              <i className="fas fa-home fa-6x"></i>
				              <h2 className="float-right font-weight-bold" style={{fontSize: '50px', textAlign: 'center'}}>{this.renderNumberOfBien}<span className="d-block">biens</span></h2>
				            </div>
				            
				          </div>
				          <div className="card mt-5">
					            <div className=" text-white p-4 " style={{backgroundColor:'#ed7e24'}}>
		                      <i className="fas fa-list-ul fa-6x"></i>
		                      <h2 className="float-right font-weight-bold" style={{fontSize: '40px', textAlign: 'center'}}>xx <span className="d-block">xxxxxxxxxx</span></h2>
		                    </div>
				            
				          </div>
				          
				      </div> 
				      <div className="col-8 ">
				        <h2 style={{backgroundColor: '#ed7e24'}} className="text-white p-2 ">Mes biens</h2>
				        <div className="container d-flex justify-content-center">
				        
				        <table className="table mt-3">
				          <thead className="table-dark">
				            <tr>
				              <th>#</th>
				              <th>id</th>
				              <th>Type</th>
				              <th>Adresse</th>
				              <th>Code Postal</th>
				              <th>Ville</th>
				              <th>Action</th>
				            </tr>
				          </thead>
				          <tbody>

				          </tbody>
				        </table>
				      </div>
				    </div>
				      
				    </div>
				</div>
				
				{infos.length > this.state.personPerPage ? <ReactPaginate pageCount={Math.ceil(infos.length/this.state.personPerPage)} pageRangeDisplayed={2}  marginPagesDisplayed={2} onPageChange={(data) =>this.paginate(data.selected+1)} containerClassName={"pagination"} previousLabel={"précédent"} nextLabel={"suivant"}/> : ''}
				</div>
			</div>
			)
	}
}

const mapStateToProps=state =>({
	infos: state.infos
 })
 
 export default connect(
   mapStateToProps, {
	 fetchInfos })(HomePage)
